import React from 'react';
import './AvailableFlights.css';
import { connect } from 'react-redux';

const AvailableFlights = (props) => {
    return (
        <div className="AvFlightsContainer">
            <ul className="AvFlightsUl">
                <li>{props.state.availableFlights}</li>
                <li>s</li>
                <li>a</li>
                <li>1d</li>
            </ul>
        </div>
    )
}

const mapStateToProps = state => {
    return {
        avFlights: state.availableFlights,
        selFlight: state.selectedFlight
    }
}

export default connect(mapStateToProps)(AvailableFlights);
